from collections import deque


class Solution:
    def shortestPathBinaryMatrix(self, grid):
        aux = [(0, 0)]
        n = len(grid)
        if n == 1 and grid[0][0] == 0:
            return 1
        if grid[0][0] == 1:
            return -1
        cnt = 1
        grid[0][0] = 1
        directions = [(-1, 1), (0, 1), (1, -1), (1, 0), (1, 1)]
        while aux:
            t = []
            for i in aux:
                for d in directions:
                    x = i[0] + d[0]
                    y = i[1] + d[1]
                    if x < 0 or y < 0 or x == n or y == n or grid[x][y]:
                        continue
                    if x == n - 1 and y == n - 1:
                        return cnt + 1
                    grid[x][y] = 1
                    t.append((x, y))
            cnt += 1
            print(t)
            aux = t
        return -1


